import React from 'react';
import logo from './../../reddit';
import SearchBar from './searchBar/searchbar';
import NightMode from './nightModeToggle/nightModeToggle';
import './head.css'

function Head() {
  return (
    <nav className={'head'}>
        <img src={logo}></img>
        <SearchBar />
        <NightMode />
    </nav>
  );
}

export default Head;
